const SECTIONS = [
    { title: 'Список лиг', href: '/leagues'},
    { title: 'Расписание лиги' ,  href: '/leagueSchedule'  },
    { title: 'Команды',  href: '/teams' },
    { title: 'Расписание команды',  href: '/teamSchedule' },
  ];

const App = (props) => { 

let leag={LEAGUES};
//console.log("LEAGUES");
//console.log("props.state.period="+props.state.period);
    return(   
        <div className="app-wrapper">
          <Header/> 
          <Navbar  period={props.state.period} sections={SECTIONS}/> 
          <Periods period={props.state.period} dispatch={props.dispatch}/>
          <div className="app-wrapper-content">
            <Routes period={props.state.period } dispatch={props.dispatch} leagues={LEAGUES} />
          </div>    
        </div>
    );//return  
}//class

export default App;
